const RegisterLayout = props => (
  <div className="RegisterLayout">
    <video id="cart-video" autoPlay loop>
      <source src="../assets/cart.mp4" type="video/mp4"/>
    </video>
      {props.children}
  </div>
);

export default RegisterLayout;
